    },
    {
      titulo: 'Projeto 2',
      img: <img/>,
      detalhes:'descrição do projeto',
      },
      {
        titulo: 'Projeto 3',
        img: <img/>,
        detalhes:'descrição do projeto',
        }
  ]

  return (

    <header>
      <nav>
        <h2>Gabriel Tomé</h2>
      </nav>

      <ul>
        <li>O que eu faço?</li>
        <li>Projetos</li>
        <li>Quem sou eu?</li>
        <li>Fale comigo</li>
